import React, { useState, useEffect } from 'react';
import {
    Table,
    Button,
    Space,
    Tag,
    Modal,
    Form,
    Input,
    InputNumber,
    message,
    Spin,
    Select // Добавляем импорт Select
} from 'antd';
import { getProducts, createProduct, deleteProduct } from '../services/api';

const { Option } = Select; // Дополнительно извлекаем Option для удобства

const ProductsPage = () => {
    const [products, setProducts] = useState([]);
    const [isModalVisible, setIsModalVisible] = useState(false);
    const [loading, setLoading] = useState(true);
    const [form] = Form.useForm();

    useEffect(() => {
        const fetchProducts = async () => {
            try {
                const data = await getProducts();
                setProducts(data || []);
            } catch (error) {
                message.error('Failed to fetch products');
            } finally {
                setLoading(false);
            }
        };
        fetchProducts();
    }, []);

    const handleCreate = async () => {
        try {
            const values = await form.validateFields();
            await createProduct(values);
            message.success('Product created');
            setIsModalVisible(false);
            form.resetFields();
            const newProducts = await getProducts();
            setProducts(newProducts || []);
        } catch (error) {
            message.error('Error creating product');
        }
    };

    const handleDelete = async (id) => {
        try {
            await deleteProduct(id);
            message.success('Product deleted');
            const newProducts = await getProducts();
            setProducts(newProducts || []);
        } catch (error) {
            message.error('Error deleting product');
        }
    };

    const columns = [
        { title: 'ID', dataIndex: 'id', key: 'id' },
        { title: 'Title', dataIndex: 'title', key: 'title' },
        {
            title: 'Price',
            key: 'price',
            render: (_, product) => `$${(product?.price || 0).toFixed(2)}`
        },
        {
            title: 'Status',
            key: 'status',
            render: (_, product) => (
                <Tag color={product?.status === 'AVAILABLE' ? 'green' : 'red'}>
                    {product?.status || 'UNKNOWN'}
                </Tag>
            )
        },
        {
            title: 'Actions',
            key: 'actions',
            render: (_, product) => (
                <Button danger onClick={() => handleDelete(product.id)}>Delete</Button>
            ),
        },
    ];

    return (
        <Spin spinning={loading}>
            <Button
                type="primary"
                onClick={() => setIsModalVisible(true)}
                style={{ marginBottom: 16 }}
            >
                Create Product
            </Button>

            <Table
                columns={columns}
                dataSource={products}
                rowKey="id"
                loading={loading}
            />

            <Modal
                title="Create Product"
                visible={isModalVisible}
                onOk={handleCreate}
                onCancel={() => setIsModalVisible(false)}
            >
                <Form form={form} layout="vertical">
                    <Form.Item name="title" label="Title" rules={[{ required: true }]}>
                        <Input />
                    </Form.Item>
                    <Form.Item name="description" label="Description">
                        <Input.TextArea />
                    </Form.Item>
                    <Form.Item name="price" label="Price" rules={[{ required: true }]}>
                        <InputNumber min={0} style={{ width: '100%' }} />
                    </Form.Item>
                    <Form.Item name="status" label="Status" initialValue="AVAILABLE">
                        <Select>
                            <Option value="AVAILABLE">Available</Option>
                            <Option value="OUT_OF_STOCK">Out of stock</Option>
                        </Select>
                    </Form.Item>
                </Form>
            </Modal>
        </Spin>
    );
};

export default ProductsPage;
